<template>
    <view class='logp'>
     
       <button @tap="weizhi" v-show="sh==false" class="hq">获取地理位置</button>

        <button open-type="openSetting" @opensetting="opensetting" v-show="sh==true" class='hq'>获取地理位置</button>
    </view>
    
</template>

<script>
    import {login,panduan} from '@/util/common.js'
   
    export default {
        data() {
            return {
                sh:false,
                zhix:''
            }
        },
        onLoad(options){
            this.zhix=options.targetUrl
        },
        methods:{
            async getapi(res){
                let location=JSON.stringify(res)

                this.$store.commit('jinbawang_location_storage',location);
                
                let weizhi=await this.$WXR.post('/consumer/getLocation',{
                    isDistance:1,
                    location
                    
                })
                uni.navigateTo({
                    url:'/pages/jin_index/index'
                })
            },
            weizhi(){
    
                var _this=this
                wx.getSetting({
                    success(res) {  
                    if(res.authSetting['scope.userLocation']){   //如果之前已经授权过就直接调用
                        uni.getLocation({
                            type: 'gcj02', //返回可以用于uni.openLocation的经纬度
                            success: function (res) {
                                console.log(res)
                                const latitude = res.latitude;
                                const longitude = res.longitude;
                           
                                _this.getapi(res)
                                
                            }
                        })
                    }else{
                        wx.authorize({    //之前没有授权过就弹出授权弹窗
                            scope: 'scope.userLocation',
                            success() {
                                uni.getLocation({
                                    type: 'gcj02', //返回可以用于uni.openLocation的经纬度
                                    success: function (res) {
                                        console.log(res)
                                        const latitude = res.latitude;
                                        const longitude = res.longitude;
                                        _this.getapi(res)

                                    }
                                })
                            },
                            fail(){

                                _this.sh=true
                            }
                        })
                        
                    }
                    
                    }
                })
            },

            opensetting(res){    //wx.authorize()授权被拒绝后的二次授权设置
                var _this=this
                
                if(res.mp.detail.authSetting['scope.userLocation']){
                
                    wx.getLocation({
                        success(res){
                        
                            console.log(res)
                            const latitude = res.latitude;
                            const longitude = res.longitude;
                            
                            _this.getapi(res)
                        }
                    })
                
                    _this.sh=false
                    
                }
            }
		
        },
        onLoad(){
        
          
         
        }
    }
</script>

